function createSunburst(chartName, data, opt) {
    var sunburstChart = echarts.init(document.getElementById(chartName));
    var { title, subtitle, backgroundColor } = opt || {};
    var sunbustOption = {
        backgroundColor,
        title: {
            text: title,
            subtext: subtitle,
            textStyle: {
                fontSize: 14,
                align: 'center'
            },
            subtextStyle: {
                align: 'center'
            },
        },
        series: {
            type: 'sunburst',
            highlightPolicy: 'descendant',
            data,
            radius: [0, '50%'],
            sort: null,
            levels: [{}, {
                r0: '15%',
                r: '50%',
                itemStyle: {
                    borderWidth: 2
                },
                label: {
                    rotate: 0,
                    fontSize: 16,
                },
                downplay: {
                    label: {
                        opacity: 0.5
                    }
                }
            }, {
                r0: '50%',
                r: '90%',
                label: {
                    align: 'right'
                },
                downplay: {
                    label: {
                        opacity: 0.5
                    }
                }
            }]
        }
    };
    sunburstChart.setOption(sunbustOption);
}

function createLine(chartName, data, opt = {}) {
    const chart = echarts.init(document.getElementById(chartName));
    const option = {
        title: {
            text: opt.title,
        },
        grid: {
            left: '10%',
            bottom: '40%'
        },
        xAxis: {
            type: 'category',
            data: data.map(el => el.name),
            boundaryGap: false,
            axisLabel: {
                interval: 0,
                rotate: 90,
                formatter: (val) => {
                    return val.length > 20 ? val.substring(0, 20) + '...' : val;
                }
            },
        },
        yAxis: {
            type: 'value',
            name: opt.yAxisLabel,
            nameTextStyle: {
                align: 'left',
            }
        },
        tooltip: {
            trigger: 'axis',
            axisPointer: { // 
                type: 'line' // 'line' | 'shadow'
            }
        },
        series: [{
            data: data.map(el => el.value),
            type: 'line'
        }]
    };
    chart.setOption(option);
}


function createMultLine(chartName, dataArr, opt = {}) {
    const { xAxisLabel, yAxisName, showAvg, legend, title, theme } = opt;
    const chart = echarts.init(document.getElementById(chartName), theme);
    const option = {
        title: {
            text: title,
        },
        legend: {
            data: legend,
            bottom: 0,
        },
        grid: {
            left: '10%',
            bottom: '10%'
        },
        xAxis: {
            type: 'category',
            data: xAxisLabel,
            boundaryGap: false,
            axisLabel: {
                interval: 0,
            },
        },
        yAxis: {
            type: 'value',
            name: yAxisName,
            nameTextStyle: {
                align: 'left',
            }
        },
        tooltip: {
            trigger: 'axis',
            axisPointer: { // 
                type: 'line' // 'line' | 'shadow'
            }
        },
        toolbox: {
            show: true,
            feature: {
                dataZoom: { show: false },
                dataView: { readOnly: false },
                magicType: { type: ['line', 'bar'] },
                restore: {},
                saveAsImage: { show: false }
            }
        },
        series: dataArr.map((el, i) => {
            var temp = {
                data: el,
                type: 'line',
                name: legend[i]
            };
            if (showAvg) {
                temp.markLine = {
                    data: [
                        { type: 'average', name: '' }
                    ]
                }
            }
            return temp;
        })
    };
    chart.setOption(option);
}
/**
 * 
 * @param {*} chartName 
 * @param {*} data data.label  data.value data.legendName
 */
function createParallel(chartName, data, opt = {}) {
    var { label, value, legendName } = data;
    var legend = [];
    var parallelAxis = label.map((el, i) => {
        // legend 
        if (el === legendName) {
            legend = value.map(item => item[i]);
            return { dim: i, name: el, type: 'category', data: legend }
        }
        return { dim: i, name: el }
    });
    var { title, theme } = opt;
    var parallelOpt = {
        title: {
            text: title
        },
        legend: {
            type: 'scroll',
            bottom: 0,
            data: legend,
        },
        parallelAxis,
        parallel: {
            left: '5%',
            right: '18%',
            bottom: 100,
        },
        series: value.map((item, i) => {
            return {
                name: legend[i],
                type: 'parallel',
                lineStyle: {
                    width: 2,
                    opacity: 0.9,
                },
                data: [item],
            }
        })
    };
    var parallelChart = echarts.init(document.getElementById(chartName), theme);
    parallelChart.setOption(parallelOpt);
}

function createRadar(chartName, data, opt = {}) {
    var { title, shape, indicator, theme } = opt;
    var option = {
        title: {
            text: title
        },
        tooltip: {},
        legend: {
            type: 'scroll',
            // orient: 'vertical',
            bottom: 0,
            selected: data.selected,
            data: data.map(el => el.name)
        },
        radar: {
            name: {
                textStyle: {
                    color: '#fff',
                    backgroundColor: '#999',
                    borderRadius: 3,
                    padding: [3, 5]
                }
            },
            indicator,
        },
        series: [{
            name: title,
            type: 'radar',
            data,
            itemStyle: { normal: { areaStyle: { type: 'default' } } },
        }]
    };
    var chart = echarts.init(document.getElementById(chartName), theme);
    chart.setOption(option);
}


