function createMap(chartName, center, data, opt = {}) {
    const { title, subTitle, mapStyle, opacity } = opt;

    const option = {
        title: {
            text: title,
            subtext: subTitle,
            left: 'center'
        },
        tooltip: {
            trigger: 'item',
            formatter: (param) => {
                return (param.data && param.data.tip) || param.name;
            },
            extraCssText: 'box-shadow: 0 0 3px rgba(0, 0, 0, 0.3);'
        },
        bmap: {
            center: center || [116.2317, 39.15427],
            zoom: 5,
            roam: true,
            mapStyle: {
                styleJson: MAP_STYLE[mapStyle] || MAP_STYLE.NORMAL, // 
            }
        },
        series: [{
            name: '',
            type: 'scatter',
            coordinateSystem: 'bmap',
            data,
            symbolSize: 5,
            label: {
                normal: {
                    formatter: "",
                    position: 'right',
                    show: false
                },
                emphasis: {
                    show: true,
                    itemStyle: {
                        opacity: 1,
                    }
                }
            },
            itemStyle: {
                color: (param) => {
                    return param.data.color;
                },
                opacity: opacity || 0.6,
            },
        }, ]
    };
    const myChart = echarts.init(document.getElementById(chartName));
    myChart.setOption(option);
    return myChart;
}

function createTree(chartName, data) {
    const treeChart = echarts.init(document.getElementById(chartName));
    opt = {
        tooltip: {
            trigger: 'item',
            triggerOn: 'mousemove'
        },
        series: [{
            type: 'tree',
            data: [data],
            top: '1%',
            left: '40%',
            bottom: '1%',
            right: '50%',
            symbolSize: 7,
            label: {
                normal: {
                    position: 'left',
                    verticalAlign: 'middle',
                    align: 'right',
                    fontSize: 9,
                    formatter: (val) => {
                        if (val.data.value) {
                            return `${val.data.name} ${val.data.value}`;
                        } else {
                            return val.name;
                        }
                    }
                },

            },

            leaves: {
                label: {
                    normal: {
                        position: 'right',
                        verticalAlign: 'middle',
                        align: 'left'
                    }
                }
            },

            expandAndCollapse: true,
            animationDuration: 550,
            animationDurationUpdate: 750
        }],
        backgroundColor: "white"
    }
    treeChart.setOption(opt);
}









